import React from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  StyleSheet,
  Dimensions,
  Image,
} from 'react-native';
import { useSafeAreaInsets } from 'react-native-safe-area-context';

const { width, height } = Dimensions.get('window');

const WelcomeScreen = ({ navigation }) => {
  const insets = useSafeAreaInsets();

  const handleLogin = () => {
    navigation.navigate('Login');
  };

  const handleRegister = () => {
    navigation.navigate('Register');
  };

  return (
    <View style={[styles.container, { paddingTop: insets.top }]}>
      {/* İllüstrasyon Alanı */}
      <View style={styles.illustrationContainer}>
        <View style={styles.illustration}>
          {/* Kişi İllüstrasyonu */}
          <View style={styles.person}>
            <View style={styles.personHead} />
            <View style={styles.personBody} />
            <View style={styles.personArm} />
            <View style={styles.laptop} />
            <View style={styles.laptopScreen} />
            <View style={styles.chair} />
            <View style={styles.chairBack} />
            <View style={styles.personLegs} />
            <View style={styles.personFeet} />
          </View>

          {/* Sağ taraftaki bitki */}
          <View style={styles.plant}>
            <View style={styles.plantPot} />
            <View style={styles.plantStem} />
            <View style={[styles.leaf, styles.leaf1]} />
            <View style={[styles.leaf, styles.leaf2]} />
            <View style={[styles.leaf, styles.leaf3]} />
            <View style={[styles.leaf, styles.leaf4]} />
          </View>
        </View>
      </View>

      {/* Metin Alanı */}
      <View style={styles.textContainer}>
        <Text style={styles.title}>Discover Your{"\n"}Dream Job here</Text>
        <Text style={styles.subtitle}>
          Explore all the existing job roles based on your{"\n"}interest and study major
        </Text>
      </View>

      {/* Buton Alanı */}
      <View style={styles.buttonContainer}>
        <TouchableOpacity style={styles.loginButton} onPress={handleLogin}>
          <Text style={styles.loginButtonText}>Login</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.registerButton} onPress={handleRegister}>
          <Text style={styles.registerButtonText}>Register</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FFFFFF',
    paddingHorizontal: 24,
  },
  illustrationContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    paddingVertical: 40,
  },
  illustration: {
    width: width * 0.8,
    height: height * 0.4,
    position: 'relative',
  },
  // Kişi İllüstrasyonu
  person: {
    position: 'absolute',
    left: 50,
    top: 20,
  },
  personHead: {
    width: 40,
    height: 40,
    backgroundColor: '#FDBCB4',
    borderRadius: 20,
    position: 'absolute',
    top: 0,
    left: 15,
  },
  personBody: {
    width: 60,
    height: 80,
    backgroundColor: '#3B82F6',
    borderRadius: 15,
    position: 'absolute',
    top: 35,
    left: 5,
  },
  personArm: {
    width: 25,
    height: 40,
    backgroundColor: '#3B82F6',
    borderRadius: 12,
    position: 'absolute',
    top: 45,
    left: -15,
    transform: [{ rotate: '15deg' }],
  },
  laptop: {
    width: 50,
    height: 35,
    backgroundColor: '#374151',
    borderRadius: 5,
    position: 'absolute',
    top: 80,
    left: 20,
  },
  laptopScreen: {
    width: 45,
    height: 30,
    backgroundColor: '#1F2937',
    borderRadius: 3,
    position: 'absolute',
    top: 82,
    left: 22,
  },
  chair: {
    width: 80,
    height: 15,
    backgroundColor: '#E5E7EB',
    borderRadius: 8,
    position: 'absolute',
    top: 115,
    left: -5,
  },
  chairBack: {
    width: 15,
    height: 60,
    backgroundColor: '#E5E7EB',
    borderRadius: 8,
    position: 'absolute',
    top: 70,
    left: -10,
  },
  personLegs: {
    width: 50,
    height: 60,
    backgroundColor: '#1F2937',
    borderRadius: 10,
    position: 'absolute',
    top: 115,
    left: 10,
  },
  personFeet: {
    width: 60,
    height: 15,
    backgroundColor: '#1F2937',
    borderRadius: 8,
    position: 'absolute',
    top: 170,
    left: 5,
  },
  // Bitki İllüstrasyonu
  plant: {
    position: 'absolute',
    right: 30,
    bottom: 20,
  },
  plantPot: {
    width: 40,
    height: 50,
    backgroundColor: '#6B7280',
    borderRadius: 5,
    position: 'absolute',
    bottom: 0,
  },
  plantStem: {
    width: 4,
    height: 40,
    backgroundColor: '#10B981',
    position: 'absolute',
    bottom: 50,
    left: 18,
  },
  leaf: {
    width: 20,
    height: 30,
    backgroundColor: '#3B82F6',
    borderRadius: 15,
    position: 'absolute',
  },
  leaf1: {
    bottom: 80,
    left: 5,
    transform: [{ rotate: '-30deg' }],
  },
  leaf2: {
    bottom: 85,
    left: 25,
    transform: [{ rotate: '30deg' }],
  },
  leaf3: {
    bottom: 100,
    left: 0,
    transform: [{ rotate: '-45deg' }],
  },
  leaf4: {
    bottom: 105,
    left: 30,
    transform: [{ rotate: '45deg' }],
  },
  // Metin Stilleri
  textContainer: {
    paddingHorizontal: 20,
    paddingVertical: 30,
    alignItems: 'center',
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: '#3B82F6',
    textAlign: 'center',
    lineHeight: 36,
    marginBottom: 16,
  },
  subtitle: {
    fontSize: 16,
    color: '#6B7280',
    textAlign: 'center',
    lineHeight: 24,
  },
  // Buton Stilleri
  buttonContainer: {
    paddingHorizontal: 20,
    paddingBottom: 40,
    gap: 16,
  },
  loginButton: {
    backgroundColor: '#3B82F6',
    paddingVertical: 16,
    borderRadius: 25,
    alignItems: 'center',
    shadowColor: '#3B82F6',
    shadowOffset: {
      width: 0,
      height: 4,
    },
    shadowOpacity: 0.3,
    shadowRadius: 8,
    elevation: 8,
  },
  loginButtonText: {
    color: '#FFFFFF',
    fontSize: 18,
    fontWeight: '600',
  },
  registerButton: {
    backgroundColor: 'transparent',
    paddingVertical: 16,
    borderRadius: 25,
    alignItems: 'center',
  },
  registerButtonText: {
    color: '#3B82F6',
    fontSize: 18,
    fontWeight: '600',
  },
});

export default WelcomeScreen;
